import {BrowserRouter as Router , Routes , Route } from "react-router-dom";
import NavBar from "./components/NavBar";
import Product from "./components/Product";
import MensClothing from "./components/MensClothing";
import WomensClothing from "./components/WomensClothing";
import Jeweleries from "./components/Jeweleries";
import Electronics from "./components/Electronics";
import Footer from "./components/Footer";

function App() {
  return (

    <div className="App" >
  <NavBar/>
    <Router>
      <Routes>
        <Route exact path = "/" element={<>  <Product/> </>}/>
        <Route exact path = "/mensClothing" element={<> <NavBar/> <MensClothing/> </>}/>
        <Route exact path = "/womensClothing" element={<> <NavBar/> <WomensClothing/> </>}/>
        <Route exact path = "/jeweleries" element={<> <NavBar/> <Jeweleries/> </>}/>
        <Route exact path = "/electronics" element={<> <NavBar/> <Electronics/> </>}/>
      </Routes>
     </Router>
     <Footer/>
    </div>
  );
}

export default App;
